<script setup>
import { nextTick, onMounted, ref, watch } from 'vue'

// eslint-disable-next-line no-undef
const emit = defineEmits(['continue'])

const replicStepAskWaiting = ref(false)

const nextStep = () => {
    replicStepAskWaiting.value = false
    replicStep.value += 1
}

let text1

const replicStep = ref(0)

watch(replicStep, (value) => {
    switch (value) {
        case 1:
            text1.classList.add('visible')
            break;

        case 2:
            emit('continue')
            replicStepAskWaiting.value = true
            break;

        default:
            break;
    }
    
})

onMounted(async () => {
    await nextTick()

    document.addEventListener('nextReplic', () => {
        replicStep.value += 1
    })

    text1 = document.querySelector('#text-4')
})

// eslint-disable-next-line no-undef
defineExpose({
    nextStep
})
</script>

